import React from 'react';
import Encabezado from './Encabezado';

class SeccionCamiones extends React.Component{
    render(){
        return(
            <div>
                <h1>Camiones</h1>
                <p>Especificar cantidad de camiones y capacidad de cada uno</p>
                <form className="form-inline">
                    <div className="form-group mb-2">
                        <input type="text" readonly className="form-control-plaintext" id="staticEmail2" value="Camion 1" />
                    </div>
                    <div className="form-group mx-sm-3 mb-2">
                        <label for="capacidad" className="sr-only">Capacidad</label>
                        <input type="text" className="form-control" id="capacidad" placeholder="Password"/>
                    </div>
                    <button type="submit" className="btn btn-primary mb-2">Confirm identity</button>
                    </form>
            </div>
        )
    }
}

export default SeccionCamiones;
